@LiarinChina @Mashimaro77 @CIA_in_China Russia is not equal to the Soviet Union.
If  you talk about "Stalin's steamroller" it only makes sense if you are talking about soldiers.
It's completely stupid to add civilian losses to Soviet losses and then blame the ratio on "Stalin's steamroller".

